  baseURL: "https://run.mocky.io/v3/9ddcc153-4ecb-4420-9c62-0e0a204e25b8",
});

function App() {

  return (
    api.get('/').then((res) => {
      console.log(res.data);
      // this.setState({ courses: res.data });
    })
  );
}

export default App;
